      {/*            /!*</svg>*!/*/}
      {/*            <BsPersonCircle />*/}
      {/*          </a>*/}
      {/*          <div className="dropdown-menu">*/}
      {/*            <a className="dropdown-item" href="/profile">{profile.fullName}</a>*/}
